import Link from 'next/link'


export default function Header() {
  return (
    <div className="container" >
      <Link href="/">
        <a className="h1">First Page</a>
      </Link>
     

      <style jsx>
        {`
        .container{
           background:#ef5359;
           min-height:60px;
           margin:0px;
           display:flex;
           flex-diraction:row;

        }
        `}
      </style>
    </div>
  )
}
